export default class NewsPage extends Component {
  render() {
    return (

      <section className="news-content-wrapper">

        <div className="news-area">

          <NewsForm />

          <NewsList />

        </div>

        <div className="enot-wrapper">
          <img className="enot" id="enot" src={enot} alt="" />
        </div>

      </section>

    );
  }
}
